ButtonCell.prototype=Object.create(Cell.prototype);function ButtonCell(a){Cell.apply(this,[null,a])}ButtonCell.prototype.buildContents=function(){var a=document.createElement("button");a.type="button";a.className="close";a.setAttribute("aria-hidden","true");a.innerHTML="&times;";$(a).click(this.onclick);return a};ButtonCell.prototype.onclick=function(){$(this).closest("tr")[0].row.deleteRow()};
